import { BrowserRouter } from 'react-router-dom';
import { Provider} from 'react-redux';
import { } from 'redux';
 const WITHDORW_MANY="WITHDORW_MANY"
const DIPOSED_MONAY="DIPOSED_MONAY"
const action=(amount)=>{
    return{
        type:WITHDORW_MANY,
        paylod:amount
    }
}
const action2=(amount)=>{
    return{
        type:DIPOSED_MONAY,
        paylod:amount
    }
}

const reduser=(state=1000,action)=>{
    switch(action.type){
        case WITHDORW_MANY:
            return state-action.paylod
            case DIPOSED_MONAY:
                return state+action.paylod
                default:
                    return state
                }
            }
            const Store=createStore(reduser)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
<BrowserRouter>
<Provider store={Store}>
<App/>
</Provider> 
</BrowserRouter>

